極小言語戦略とは, 正提示に対して無矛盾な言語の内, 極小なものを推論結果として出力する手法を言う. ここで極小であるとは, 言語の集合としての包含関係によって定まる順序に関する. （最小とは限らないので極小であることに注意.） そしてその極小な言語を 極小言語 (minimal language; minl) と言う. いくつかの汎化システムが成す言語クラスは実は極小戦略によって推論可能である. この戦略はすなわち, 無矛盾なものであればいくらでもありえるし特に \( \top \in D \) といった自明なものもある中で, 集合の小ささと推論の良さと思おうという気持ちである. \( S \) から極小言語（その description）を出力する仮定を MINL とすれば極小言語戦略とは次のような擬似コードで表される: S = set()
g = None # この時点の推論結果
while s = input(): S.add(s) if s in L(g): guess(g) # 更新の必要なし else: g = MINL(S) # 更新 guess(g)
